import React from 'react';
import ReactDOM from 'react-dom';
import {Link} from 'react-router';

const Home = (props) => {
    return(
        <div id="home">
            <h1>Home</h1>
            <Link to="/projects">Projects</Link>
        </div>
    )
}

export default Home;
